function load_for_bili_setting(i, s, a) {
    return new Vue({
        el: "#app",
        data: {
            vm: this,
            wss: a,
            music_info: [],
            console_info: [ "" ],
            c_num: 0,
            m_num: 0,
            url: i.url,
            where: i.where,
            who_i_am: "lyric" === i.where,
            music_mask: !1,
            playlist: [],
            playlist_name: [],
            playlist_mask: !1,
            playlist_id: "",
            playlist_raw: "",
            playlist_platform: "default",
            playlist_overwrite: 1,
            idle_playlist: [ {
                name: "",
                artist: "",
                platform_text: ""
            } ],
            idle_playlist_mask: !1,
            mask1: !1,
            mask2: !1,
            mask2_1: !1,
            mask2_2: !1,
            add_music: !1,
            add_playlist: !0,
            choose_overwrite: !1,
            last: "",
            utils: s,
            now_play: [ "暂无歌曲", "暂无" ],
            wait_to_play: [],
            last_list: [],
            music_list: [],
            start_flag: !1,
            scroll_flag: !0,
            play_icon_flag: 1,
            start_getting_text: "开始统计",
            play_icon: [ "icon-list_play", "icon-list_stop" ]
        },
        computed: {
            console_info_change() {
                var i = this["console_info"];
                return console.log(i), {};
            },
            music_info_change() {
                var i = this["music_info"];
                return console.log(i), {};
            }
        },
        watch: {
            console_info_change() {
                var i;
                this.c_num++, this.scroll_flag && (i = $("#console-info")).animate({
                    scrollTop: i.get(0).scrollHeight
                }, 1e3);
            },
            music_info_change() {
                this.now_play = this.music_info[0];
                var i = [ ...this.music_info ];
                i.shift(), this.wait_to_play = i, this.m_num++;
            },
            playlist_raw() {
                var i, s = {
                    ku_wo: "www.kuwo.cn",
                    cloud: "music.163.com",
                    qq: "y.qq.com"
                };
                for (i in s) if (console.log(i), -1 !== this.playlist_raw.indexOf(s[i])) {
                    this.playlist_platform = i;
                    break;
                }
                this.playlist_id = this.playlist_raw.split("/").reverse()[0].split("=").reverse()[0];
            }
        },
        methods: {
            delete_music(i, s, l) {
                a.del_music(this.url, this.where, s, l);
            },
            move_music(i, s, l, t) {
                a.move_music(this.url, this.where, s, l, t);
            }
        },
        created() {}
    });
}